import './App.css';
import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom';

// function App() {
//   return (
//     <>
//       <Router>
//         <Navbar />
//         <Routes>
//           {/* <Route path='/' exact Component={Home} /> */}
//           <Route path="/" exact Component={WorldMap} />
//           <Route path='/services' exact Component={Services} />
//           <Route path='/products' exact Component={Products} />
//           <Route path='/sign-up' exact Component={SignUp} />
//         </Routes>
//       </Router>
//     </>
//   );
// }

// export default App


function MealPlan({ addFavorite }) {
  const [mealPlan, setMealPlan] = useState([]);

  const generateMealPlan = () => {
    setMealPlan(['Meal 1', 'Meal 2', 'Meal 3']);
  };

  return (
    <div>
      <h2>Your Weekly Meal Plan</h2>
      <button onClick={generateMealPlan}>Generate Meal Plan</button>
      <ul>
        {mealPlan.map((meal, index) => (
          <li key={index}>
            {meal} 
            <button onClick={() => addFavorite(meal)}>Add to Favorites</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

function Favorites({ favorites }) {
  return (
    <div>
      <h2>Your Favorites</h2>
      <ul>
        {favorites.map((meal, index) => (
          <li key={index}>{meal}</li>
        ))}
      </ul>
    </div>
  );
}

// function Articles({ readArticle, articles }) {
//   return (
//     <div>
//       <h2>Daily Articles</h2>
//       <button onClick={readArticle}>Read Today's Articles</button>
//       <ul>
//         {articles.map((article, index) => (
//           <li key={index}>{article}</li>
//         ))}
//       </ul>
//     </div>
//   );
// }

// function Region({ region, setRegion }) {
//   return (
//     <div>
//       <h2>Regional Menus</h2>
//       <p>Explore popular dishes from your region: {region}</p>
//       <select onChange={(e) => setRegion(e.target.value)}>
//         <option value="Your Region">Your Region</option>
//         <option value="Region 1">Region 1</option>
//         <option value="Region 2">Region 2</option>
//       </select>
//     </div>
//   );
// }

function MyFridge({ handleMyFridge }) {
  return (
    <div>
      <h2>MyFridge Integration</h2>
      <button onClick={handleMyFridge}>Add Ingredients to MyFridge</button>
    </div>
  );
}

function App() {
  const [favorites, setFavorites] = useState([]);

  const addFavorite = (meal) => {
    setFavorites([...favorites, meal]);
  };

  const handleMyFridge = () => {
    alert('Ingredients added to MyFridge!');
  };

  return (
    <Router>
      <div>
        <header>
          <h1>Healthy Meal Planner</h1>
          <p>Eat healthy and on time, effortlessly!</p>
          <nav>
            <ul>
              <li><Link to="/meal-plan">Meal Plan</Link></li>
              <li><Link to="/favorites">Favorites</Link></li>
              <li><Link to="/articles">Articles</Link></li>
              <li><Link to="/region">Region</Link></li>
              <li><Link to="/MyFridge">MyFridge</Link></li>
            </ul>
          </nav>
        </header>

        <Routes>
          <Route path="/meal-plan" element={<MealPlan addFavorite={addFavorite} />} />
          <Route path="/favorites" element={<Favorites favorites={favorites} />} />
          <Route path="/articles" element={<Articles readArticle={readArticle} articles={articles} />} />
          <Route path="/region" element={<Region region={region} setRegion={setRegion} />} />
          <Route path="/MyFridge" element={<MyFridge handleMyFridge={handleMyFridge} />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
